import React from 'react';
import { Link } from "react-router-dom";

// Button that triggers AR quick look module

class TwoButtons extends React.Component { 
    render() {
        return (
            <div id="TwoButtons">
                <ul>
                <div id="Button">
                  <a href="https://apps.8thwall.com/ahyiquuj/ARCam1/">
                  <img src="media/ar-button.jpg" alt="AR-Button" width="25%" height="auto"/>            
                  </a>
                 </div>
                 </ul>

                 <ul>
                 <div id="Button">
                    <Link to="2dpighli3d">
                        <img src="media/3D-button.jpg" alt="3D-Button" width="25%" height="auto"/>
                    </Link>
                 </div>
                 </ul>
            </div>

        )
    }
}

export default TwoButtons;
